import styled from 'styled-components';
import Card from '../../../../card/Card';
import database from '../../../../database';


const WelcomeDiv = styled.div`
    min-height: 300px;
    text-align: center;
`;

const Title = styled.h1`
    font-size: 27px;
    text-align: center;
`

const Welcome = () => {
    return(
        <div>
            <Title>Closing Deals</Title>
            <WelcomeDiv>
                <Card prop={database.products[0]}  />
            </WelcomeDiv>
        </div>
    )
}

export default Welcome;
